.animated.bounceIn,
.animated.bounceOut
  animation-duration .3s
.q-animate--scale
  animation q-scale .15s
  animation-timing-function cubic-bezier(.25, .8, .25, 1)
@keyframes q-scale
  0%
    transform scale(1)
  50%
    transform scale(1.04)
  100%
    transform scale(1)
.q-animate--fade
  animation q-fade .2s /* rtl:ignore */
@keyframes q-fade
  0%
    opacity 0
  100%
    opacity 1
